''' Plot '''
no_it = 50
def plot(name, MSE_min, MSE_max, p1, p2, p3, p4, p5):
    fig = plt.figure(figsize=(3.8,3.0))
    fig.subplots_adjust(left=0.15, right=0.965, bottom=0.12, top=0.97)
    plt.xlabel("Iterations", fontsize=12, labelpad=1) #fontsize=8
    plt.ylabel("MSE", fontsize=12, labelpad=2) #fontsize=8, labelpad=-1
    plt.yticks(fontsize=8) #fontsize=6
    plt.xticks(fontsize=8) #fontsize=6
    
    plt.plot(iterations[:no_it], p1[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Exp', c='red', markersize=1)
    plt.plot(iterations[:no_it], p2[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Random', c='blue', markersize=1)
    plt.plot(iterations[:no_it], p3[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, exp', c='yellow', markersize=1)
    plt.plot(iterations[:no_it], p4[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, random', c='green', markersize=1)
    plt.plot(iterations[:no_it], p5[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, least squares', c='orange', markersize=1)
    
    plt.xlim(0,no_it+1)
    plt.ylim(MSE_min,MSE_max)
    
    plt.legend(loc='upper right',fontsize=8)
    plt.savefig("./%s.png" % name, dpi=600)
    
    
